import React, {Component} from 'react';
import './Home.css';
import {Page as OnsPage} from 'react-onsenui';
import HomeToolbar from './HomeToolbar'


class Home extends Component{


    render() {
        return (
            <OnsPage
                className={'home-component'}
                renderToolbar={() => {
                    return (
                        <HomeToolbar
                            signIn = {this.props.signIn}
                            title={'Home'}
                        />)
                }}
                style={{
                    backgroundColor: 'red',
                    backgroundSize: 0,
                }}
            >
                {
                    this.props.content
                }
            </OnsPage>
        );
    }
}

export default Home;
